function Modal(props){

  const closeModal = (event) => {
    props.setShowModal(false);
  }

  if(props.showModal){
    return(
      <div className="Modal">
          <div className="modalText">
            <div>
              Your order has been created!
            </div>
            <div>
              <button onClick={closeModal}>Done</button>
            </div>
          </div>
      </div>
    )
  } else {
    return(
      <div>&nbsp;</div>
    )
  }
}

export default Modal;
